import React, {useState, useEffect} from "react";
import "../styles/pharmacies.css";
import LocationCard from "../shared/LocationCard";
import CommonSection from "../shared/pharmacie/CommonSection-pharmacie";
import SearchBar from "../shared/SearchBar";
import { Col, Container, Row } from "reactstrap";
import pharmacieData from "../assets/data/pharmacies";
const Pharmacies = () => {

    return (
    <>
    <CommonSection title={"All Pharmacies"} />
    <section>
        <Container>
            <Row>
                <SearchBar />
            </Row>
        </Container>
    </section>
    <section>
        <Container>
            <Row>
                {
                    pharmacieData?.map(location => <Col lg="3" key={location.id}> <LocationCard location={location} /></Col>)

                }
            </Row>
        </Container>
    </section>
    </>
    )


};
export default Pharmacies;
